// Navbar.js

import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { logoutUser } from '../actions/authentication';
import { withRouter } from 'react-router-dom'

class Navbar extends Component {

    onLogout(e) {
        e.preventDefault();
        this.props.logoutUser(this.props.history)
    }

    render() {
        const { isAuthenticatedUser, user } = this.props.auth
        const authLinks = (
            <ul className="navbar ml-auto">
                <a href="#" className="nav-link" onClick={this.onLogout.bind(this)}>
                <img src={user.avatar} alt={user.name} title={user.name}
                        className="rounded-circle"
                        style={{ width: '25px', marginRight: '5px'}} />
                            Logout
                </a>
            </ul>
        )
        const guestLinks = (
            <ul className="navbar-nav ml-auto">
                <li className="nav-item">
                    <Link className="nav-link" to="/register">Sign Up</Link>
                </li>
                <li className="nav-item">
                    <Link className="nav-link" to="/login">Sign In</Link>
                </li>
            </ul>
          )
        return(
            <nav className="navbar navbar-expand-lg nav-light-bg bg-light">
                <Link className="navbar-brand" to="/">Vet PAL</Link>
                <div className="callapse navbar-collapse" id="navbarSupportedContent">
                    { isAuthenticatedUser ? authLinks : guestLinks}
                </div>
            </nav>
        )
    }
}

PropTypes.Navbar = {
    logoutUser: PropTypes.func.isRequired,
    auth: PropTypes.object.isRequired
}

mapStateToProps = (state) => ({
    auth: state.auth
})

export default connect(mapStateToProps, { logoutUser })(withRouter(Navbar));
